class Avast(Quarantine):
    """Implements Avast quarantine format"""

    def __init__(self):
        super().__init__()
        self.name = 'Avast'
        self.location = Path('ProgramData/Avast Software/Avast/chest')

    # Cleanup
    def __del__(self):
        if hasattr(self, 'db'):
            self.db.close()
            unlink(self.tmpfile)

    def _initDB(self):
        # Parse index.xml
        self.root = ET.parse(self.location / 'index.xml').getroot()

        # Decrypt vault.db and prepare db connection
        self.tmpfile = tempfile.mkdtemp() + '/decrypted.db'
        with open(self.tmpfile, 'wb') as f:
            f.write(self._decryptVault('$AV_ASW/$VAULT/vault.db'))

        try:
            self.db = sqlite3.connect(self.tmpfile)
        except Exception as e:
            print('Avast DB Error: ' + str(e))

