    def _getRawFromVault(self, path):

        query = (f'SELECT data FROM vault\n'
                 f'INNER JOIN crossRef ON id = crossRef.vaultid\n'
                 f'INNER JOIN stream ON crossRef.streamId = stream.streamId\n'
                 f'WHERE filename="{path}"')

        cursor = self.db.cursor()
        cursor.execute(query)
        blob = cursor.fetchone()[0]
        return blob

