    def export(self):
        self._initDB()
        quarfiles = []

        # Return the value of a field 'f'
        def get(e, f):
            return e.find(f).text

        for e in self.root.findall('ChestEntry'):
            chest_id = get(e, 'ChestId')
            path = get(e, 'OrigFolder') + '\\' + get(e, 'OrigFileName')
            # Check if an entry is in the vault.db
            is_in_vault = e.find('IDPBlob') is not None
            if is_in_vault:
                malfile = self._getRawFromVault(path)
            else:
                malfile = self._getRawFromFile(chest_id)

            q = QuarEntry()
            q.timestamp = dt.fromtimestamp(int(get(e, 'TransferTime')))
            q.threat = get(e, 'Virus')
            q.path = path
            q.size = len(malfile)
            q.md5 = md5(malfile).digest().hex()
            q.malfile = malfile

            quarfiles.append(q)

        return quarfiles
